import s from "./App.module.css";
import Nav from "./components/Nav/Nav";
import Footer from "./components/Footer/Footer";
import Profile from "./components/Main/Profile/Profile";
import { Routes, Route } from "react-router-dom";
import Friends from "./components/Main/Friends/Friends";
import DialogsConteiner from './components/Main/Dialogs/DialogsContainer';
import StoreContext from './StoreContext';


function App(props) {
  return (
      <div className={s.app_wrapper}>
        <StoreContext.Provider value={props.store}/>

        <Nav data={props.state.NavMenu} />
        <Routes>
          <Route
            path="/"
            element={<Profile store={props.store}/>}
          />
          <Route
            path="/Profile"
            element={<Profile store={props.store}/>}
          />
          <Route
            path="/Dialogs"
            element={<DialogsConteiner store={props.store}/>}
          />
          <Route path="/Friends" element={<Friends data={props.state.FriendsPage}/>} />
        </Routes>
        <Footer />
      </div>
  );
}

export default App;
